@VueComponent(mixins: const [BaseMixin], template: r'''
<m-dialog
  v-on="$listeners"
  :theming="theming"
  :scrollable="scrollable"
  v-bind:open="open"
  @change="$emit('change', $event.target.open)"
  @accept="$emit('accept')"
  @cancel="$emit('cancel')"
>
  <template v-if="$slots.header" slot="header">
    <slot name="header"></slot>
  </template>
  <template v-if="$slots.body" slot="body">
    <slot name="body"></slot>
  </template>
  <template v-if="$slots.acceptButton" slot="acceptButton">
    <slot name="acceptButton"></slot>
  </template>
  <template v-if="$slots.cancelButton" slot="cancelButton">
    <slot name="cancelButton"></slot>
  </template>
  <template v-if="$slots.dialogButton" slot="dialogButton">
    <slot name="dialogButton"></slot>
  </template>
</m-dialog>''')
class MDialog extends VueComponentBase with BaseMixin {
  MDialog() { _initialize(); }
  @prop
  bool scrollable = false;
  @prop
  bool open = false;
}
